/**ABDB**/CREATE TABLE `oficiales` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `oficial` varchar(100) NOT NULL,
  `nombre` varchar(100) NOT NULL,
  `descripcion` text NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;
/**ABDB**/INSERT INTO `oficiales`  VALUES 
('1', 'Oficial #1', 'ESTABLECER', 'Días favorables para comenzar negociaciones, tratamientos médicos, viajes largos, viajes de avión, estudios académicos, cursos, edificación o construcción (No demolición, o abrir huecos) Bueno para comprometerse o proponer matrimonio (pero no casarse), comenzar nuevo trabajo o negocio, reuniones de negocios. Días desfavorbales para demolición, abrir huecos o asistir a entierros.'),
('2', 'oficial #2 ', 'REMOVER ', 'Días buenos para operaciones que remuevan condiciones desfavorables del cuerpo. Favorables para actividades de limpieza, remover cosas viejas, comenzar trabajos de demolición o reparación en propiedades. También se usa para terminar relaciones, separaciones o divorcios. Días desfavorables para mudanzas, apertura de negocios, comenzar un nuevo trabajo, viajar, mudarse o boda.'),
('3', 'Oficial #3', 'LLENAR', 'Días para llenarse de algo. Favorable para apertura de negocios,  inauguración de negocios o residencias, cobrar deudas (pues se cobrarán en su totalidad)  Bueno para firmar contratos que le dejen mucha abundancia, pero cuide los contratos legales como demandas, pues puede llenarse de problemas legales.  Lo mismo tenga cuidado si desea empezar un nuevo trabajo pues estará lleno de trabajo y  responsabilidaes. Días desfavorables para demolición y asistir a entierros.'),
('4', 'Oficial #4 ', 'BALANCE', 'Días favorables para viajes, construcción, matrimonio, negociaciones comerciales de igual beneficio para las partes, asociaciones que participan al 50%. Las actividades estos días se consideran beneficiosas para ambos lados, no a favor o contra tuyo, simplemente están balanceadas.  Dias desfavorables para negociar distribución de bienes, comienzo de acción legal o asistir a entierros.'),
('5', 'Oficial #5', 'ARMONIA', 'Días estables y favorables para comenzar relaciones a largo plazo, como matrimonio, apertura de negocios, comienzo de proyectos a largo plazo, contratar personal importante, inauguraciones, construcción, tratamientos médicos para sanación permanente o duradera.  Días desfavorables para viajes, mudanzas y entierros.'),
('6', 'Oficial #6', 'INICIAR', 'Excelente día para comenzar algo, firma de contratos o acuerdos, aceptación de convenios, compromisos, comienzo de proyectos nuevos, apertura de negocios, inicio de construcción, remodelación de propiedades. Evitar mudanzas y viajes estos días.'),
('7', 'Oficial #7', 'DESTRUCCIÓN', 'Representa la destrucción de algo. Días favorables para demoler estructuras viejas, comienzo para remover superficies en trabajos de remodelación. Días desfavorables para apertura de negocios, viajes, firma de contratos, matrimonio, comprometerse, convenios.'),
('8', 'Oficial #8', 'PELIGRO', 'Días llenos de incertidumbre. Favorables para actividades espirituales, remover objetos y artículos que no se usen, abrir zurcos para construcción, ubicación de camas para dormir. Días desfavorables para viajes largos, matrimonio, procedimientos médicos, actividades deportivas, visitar lugares elevados o el mar.'),
('9', 'Oficial #9', 'ÉXITO', 'Es el día más próspero de todos. Las energías son muy positivas y favorables para todo tipo de actividad, como matrimonio, comprometerse, procedimientos médicos, mudanzas, propuestas de negocios, incluyendo entierros. Evite acciones legales, porque podría tener muchas demandas, (aunque exitosas).'),
('10', 'Oficial #10', 'RECIBIR', 'Días favorables para obtener algo en particular, pedir préstamos, solicitar promociones en el trabajo, pedir aumento de sueldo, comenzar curso académico, firma de contratos, proponer matrimonio, proponer nuevas ideas.  Días desfavorables para tratamientos médicos (Pues no se desea seguir recibiendo tratamientos), visitar enfermos, entierros. '),
('11', 'Oficial #11', 'ABRIR', 'Días favorables para recepciones, apertura de negocios, firma de contratos, matrimonio, comienzo de nuevo trabajo, compromisos de negocios, comienzo de cursos académicos. Evite remodelaciones de propiedades.'),
('12', 'Oficial #12', 'CERRAR', 'Dia de estancamiento, la energía no se mueve pues está en su punto más bajo, desfavorable para cualquier actividad importante para la persona');
